import React from 'react';
import './style.css'
import Logo from '../assets/image/Logo.png'


function Header(props) {
    return (
        <div>
            <h1>Medecine</h1>
            <img className='logoPng' src={Logo} alt=""/>
        </div>
    );
}

export default Header;
